import React from 'react'

const HeaderComponent = () => {
  return (
    <div>
        <header>
        <nav class="navbar navbar-dark bg-dark">
            <a class="navbar-brand" href="#">User Management System</a>
        </nav>
        </header>
    </div>
  )
}

export default HeaderComponent
